import React, { useState } from 'react';
import styles from './EditProfileStudentForm.module.css';
import styles_base from '../../Forms/FormsBase.module.css';
import prev from './prev.png';
import next from './next.png';
import { Button, Container, Row, Form, Col, Image } from 'react-bootstrap';

function EditProfileStudentForm() {
  const [step, setStep] = useState(1);

  const nextStep = () => {
    setStep(step + 1);
  };

  const prevStep = () => {
    setStep(step - 1);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Ваша логика обработки отправки формы
  };

  return (
    <Container>
      <div className={styles_base.card}>
        <form className="px-4 mx-2 my-1" onSubmit={handleSubmit}>
          {/* Step 1 */}
          {step === 1 && (
            <div className="step active" id="step1">
              <h5 className="text-center py-2">Основная информация</h5>
              <div className={styles_base.block_form}>
                <Form.Group as={Row} controlId="input1">
                  <Form.Label column sm={3}>ФИО</Form.Label>
                  <Col sm={7}>
                    <Form.Control type="text" placeholder="ФИО" />
                  </Col>
                </Form.Group>
                {/* Остальные поля */}
              </div>
              <Row className="justify-content-center pt-3">
                <Button className="next" onClick={nextStep}>
                  <Image src={next} width="10%" alt="Следующий" />
                </Button>
              </Row>
            </div>
          )}

          {/* Step 2 */}
          {step === 2 && (
            <div className="step active" id="step2">
              <h5 className="text-center py-2">Успеваемость</h5>
              <div className={styles_base.block_form}>
                <Form.Group as={Row} controlId="input7">
                  <Form.Label column sm={3}>Номер зачетки</Form.Label>
                  <Col sm={7}>
                    <Form.Control type="text" placeholder="номер зачетки" />
                  </Col>
                </Form.Group>
                {/* Остальные поля */}
              </div>
              <Row className="justify-content-center pt-3">
                <Col>
                  <Button className="prev" onClick={prevStep}>
                    <img src={prev} width="10%" alt="Предыдущий" />
                  </Button>
                </Col>
                <Col>
                  <Button className="next" onClick={nextStep}>
                    <img src={next} width="10%" alt="Следующий" />
                  </Button>
                </Col>
              </Row>
            </div>
          )}

          {/* Step 3 */}
          {step === 3 && (
            <div className="step active" id="step3">
              <h5 className="text-center py-2">Успеваемость</h5>
              <div className={styles_base.block_form}>
                <Form.Group as={Row} controlId="input7">
                  <Form.Label column sm={3}>Номер зачетки</Form.Label>
                  <Col sm={7}>
                    <Form.Control type="text" placeholder="номер зачетки" />
                  </Col>
                </Form.Group>
                {/* Остальные поля */}
              </div>
              <Row className="justify-content-center pt-3">
                <Button className="prev" onClick={prevStep}>
                  <img src={prev} width="10%" alt="Предыдущий" />
                </Button>
                <Button className="next" onClick={nextStep}>
                  <img src={next} width="10%" alt="Следующий" />
                </Button>
              </Row>
            </div>
          )}
        </form>
      </div>
    </Container>
  );
}

export default EditProfileStudentForm;
